import React from 'react';
import './Widgets.scss'
const Widgets = () => {
    return (
        <div className='widget'>
            <div className="left">
                <span className="title">USERS</span>
                <span className="counter">21321</span>
                <span className="link">See all user</span>
            </div>
            <div className="right">
                <div className="percentage"></div>
            </div>
        </div>
    );
};

export default Widgets;
